from PIL import Image, ImageDraw
import random
import base64
from io import BytesIO

# Function to decode Base64 string into PIL Image
def decode_base64_to_image(base64_str):
    image_data = base64.b64decode(base64_str)
    return Image.open(BytesIO(image_data))

# Function to encode PIL Image to Base64 string
def encode_image_to_base64(image):
    image_pil = Image.open(image)
    buffered = BytesIO()
    image_pil.save(buffered, format="PNG")
    return base64.b64encode(buffered.getvalue()).decode()

# Function to generate visual cryptography shares from original image
def generate_visual_cryptography_shares(original_image):
    width, height = original_image.size
    share1 = Image.new('1', (width * 2, height))  # Share 1 will be twice as wide as original image
    share2 = Image.new('1', (width * 2, height))  # Share 2 will be twice as wide as original image
    draw1 = ImageDraw.Draw(share1)
    draw2 = ImageDraw.Draw(share2)
    
    for y in range(height):
        for x in range(width):
            pixel = original_image.getpixel((x, y))
            if pixel == 0:  # Black pixel
                draw1.point((2*x, y), 0)  # Share 1 pixel
                draw2.point((2*x+1, y), 0)  # Share 2 pixel
            else:  # White pixel
                draw1.point((2*x, y), 255)  # Share 1 pixel
                draw2.point((2*x+1, y), 255)  # Share 2 pixel
    
    return share1, share2

# Function to combine visual cryptography shares into original image
def combine_visual_cryptography_shares(share1, share2):
    # share1_pil = Image.open(share1)
    # share2_pil = Image.open(share2)
    width, height = share1.size
    combined_image = Image.new('1', (width // 2, height))  # Combined image will be half as wide as share
    
    for y in range(height):
        for x in range(width // 2):
            pixel1 = share1.getpixel((2*x, y))
            pixel2 = share2.getpixel((2*x+1, y))
            if pixel1 == 0 and pixel2 == 0:  # If both shares are black, set pixel to black
                combined_image.putpixel((x, y), 0)
            else:  # If one share is white or both are white, set pixel to white
                combined_image.putpixel((x, y), 255)
    
    return combined_image



# Example usage
if __name__ == "__main__":
    # Example Base64 encoded image string
    base64_str1 = ""

    # Decode Base64 string into PIL Image
    original_image = decode_base64_to_image(base64_str1)
    original_image.show()

    # Generate visual cryptography shares
    share1, share2 = generate_visual_cryptography_shares(original_image)

    # Display shares
    share1.show()
    share2.show()

    # Reconstruct original image from shares
    reconstructed_image = combine_visual_cryptography_shares(share1, share2)
    reconstructed_image.show()
